import React from "react";
import notes from "../notes";

var xD = notes.map(Note);
console.log(xD)

function Note(xD){
    return (
        <div className="note">
            <h1>{xD.title}</h1>
            <p>{xD.content}</p>
        </div>
    )
}



export default Note;
